import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";
import "../SignIn/SignIn.css";
import axios from "axios";
import { GoogleLogin } from "@react-oauth/google";
import { useDispatch } from "react-redux";
import { setUser } from "../redux/authSlice";
import { useQueryClient } from "@tanstack/react-query";

const Login = () => {
  const [values, setValues] = useState({
    email: "",
    password: "",
  });

  const [alert, setAlert] = useState("");
  const [alertType, setAlertType] = useState("");

  const dispatch = useDispatch();
  const navigate = useNavigate();
  const queryClient = useQueryClient();

  const handleChange = (e) => {
    setValues({ ...values, [e.target.name]: e.target.value });
  };

  const showAlert = (msg, type) => {
    setAlert(msg);
    setAlertType(type);
    setTimeout(() => {
      setAlert("");
      setAlertType("");
    }, 1000);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post(
        "http://localhost:3001/api/login",
        values,
        {
          withCredentials: true,
        }
      );

      showAlert(response.data.message, "success");


      queryClient.invalidateQueries(["enroll-status"]);
      queryClient.invalidateQueries(["me"]);

      setTimeout(() => {
        navigate("/");
      }, 500);
    } catch (error) {
      showAlert(
        error.response?.data?.message || "Login failed",
        "error"
      );
    }
  };

  const handleGoogleLogin = async (credentialResponse) => {
    try {
      await axios.post(
        "http://localhost:3001/api/google-login",
        {
          credential: credentialResponse.credential,
        },
        { withCredentials: true,
        }
      );

      showAlert("Google login successful", "success");

      dispatch(setUser());

      queryClient.invalidateQueries(["enroll-status"]);
      queryClient.invalidateQueries(["me"]);

      setTimeout(() => {
        navigate("/");
      }, 500);
    } catch(error) {
      showAlert(
        error.response?.data?.message || "Login failed",
        "error"
      );
    }
  };

  return (
    <div className="body">
      <div className="Register">
        <Link to="/" className="backBtn">Back</Link>

        <h1>Login</h1>

        {alert && <div className={`alert ${alertType}`}>{alert}</div>}

        <form onSubmit={handleSubmit}>
          <div>
            <label>Email</label>
            <input
              type="email"
              name="email"
              placeholder="Enter Email"
              onChange={handleChange}
              required
            />
          </div>

          <div>
            <label>Password</label>
            <input
              type="password"
              name="password"
              placeholder="Enter Password"
              onChange={handleChange}
              required
            />
          </div>
          <div style={{ textAlign: "right", fontSize: "15px", marginTop: "-5px", marginBottom: "2px" }}>
            <Link to= "/resetPassword">Forgot password</Link>
          </div>
          <button type="submit">Login</button>
        </form>

        <div style={{ margin: "15px 0", textAlign: "center" }}>OR</div>

        <div style={{ display: "flex", justifyContent: "center" }}>
          <GoogleLogin
            onSuccess={handleGoogleLogin}
          />
        </div>

        <div style={{ display: "flex", justifyContent: "center", marginTop: "10px" }}>
          <p>Don't have an account?</p>
          <Link to="/SignIn" style={{ marginLeft: "5px",marginTop: "17px" }}>SignIn</Link>
        </div>
      </div>
    </div>
  );
};

export default Login;
